kPrice\"&gt;$15&lt;small&gt;/ month&lt;/small&gt;&lt;/dd&gt;\r\n&lt;dd&gt;Unlimited Storage&lt;/dd&gt;\r\n&lt;dd&gt;Unlimited Transactions&lt;/dd&gt;\r\n&lt;dd&gt;Unlimited Contacts&lt;/dd&gt;\r\n&lt;dd&gt;Unlimited Users&lt;/dd&gt;\r\n&lt;dd&gt;&lt;a href=\"#\"&gt;Choose&lt;/a&gt;&lt;/dd&gt;\r\n&lt;/dl&gt;\r\n\r\n&lt;dl class=\"gkPremium\"&gt;\r\n&lt;dt&gt;Premium&lt;/dt&gt;\r\n&lt;dd class=\"gkPrice\"&gt;$99&lt;small&gt;/ month&lt;/small&gt;&lt;/dd&gt;\r\n&lt;dd&gt;Unlimited Storage&lt;/dd&gt;\r\n&lt;dd&gt;Unlimited Transactions&lt;/dd&gt;\r\n&lt;dd&gt;Unlimited Contacts&lt;/dd&gt;\r\n&lt;dd&gt;Unlimited Users&lt;/dd&gt;\r\n&lt;dd&gt;Try it for a month!&lt;/dd&gt;\r\n&lt;dd&gt;&lt;a href=\"#\"&gt;Choose&lt;/a&gt;&lt;/dd&gt;\r\n&lt;/dl&gt;\r\n\r\n&lt;dl&gt;\r\n&lt;dt&gt;Plus&lt;/dt&gt;\r\n&lt;dd class=\"gkPrice\"&gt;$29&lt;small&gt;/ month&lt;/small&gt;&lt;/dd&gt;\r\n&lt;dd&gt;Unlimited Storage&lt;/dd&gt;\r\n&lt;dd&gt;Unlimited Transactions&lt;/dd&gt;\r\n&lt;dd&gt;Unlimited Contacts&lt;/dd&gt;\r\n&lt;dd&gt;Unlimited Users&lt;/dd&gt;\r\n&lt;dd&gt;&lt;a href=\"#\"&gt;Choose&lt;/a&gt;&lt;/dd&gt;\r\n&lt;/dl&gt;\r\n&lt;/div&gt;</pre>\r\n<p>The main wrapper contains two clases: the <strong>gkPriceTable</strong> class is required as a base of the CSS styling and the second class is used to specify the amount of columns - you can use classes <strong>col1</strong>-<strong>col5</strong>.</p>\r\n<p>Every column is specified by <strong>dl</strong> element (with <strong>gkPremium</strong> class the column will be highlighted) - in the <strong>dt</strong> element you can specify the table column title. In the <strong>dd</strong> element with <strong>gkPrice</strong> class you can specify the price - using the <strong>small</strong> element you can specify te service period time.</p>\r\n<p>Adding of the button at the bottom is very simple - it needs just to add the link element in the <strong>dd</strong> element.</p>','',1,15,'2013-03-04 13:50:52',572,'','2013-04-08 10:39:36',572